(268, 61, 'Amit', 'kumar', '9876543234', 'amit@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '3', 5400, '1800', 4, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>Jiifit is India&#39;s first specialized massage service provider, offering professional massage services at clients&#39; locations, including homes, hotels, corporate offices, and private events. Founded in April 2023 by Mr. Somnath Das, Jiifit has quickly established a client base of over 1.5 lakh individuals across major Indian cities.</p>\r\n\r\n<p><strong>Services Offered:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Massage at Home:</strong> Personalized massage sessions in the comfort of your home, tailored to individual needs.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Massage at Hotels:</strong> On-demand massage services for travelers and guests, ensuring relaxation during stays.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Corporate Massage Events:</strong> On-site chair massages designed to reduce workplace stress and enhance employee well-being.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Family Massage Parties:</strong> Specialized massage packages for private events, such as weddings and birthdays, to provide gu', '<p>HTML, Css, Js and PHP, mySql and Rest API</p>', '<p>6</p>', '1740679284.jpg', '1740679165.png', NULL, '1740679285.png', '1740679285.png', 'Driving License', '1740679285.png', '1740679285.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 100, 0, '2025-02-27'),
(269, 61, 'Iqara', 'Khan', '8765435678', 'iqara@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '7', 72000, '2400', 4, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>Your project is a <strong>Laravel-based web application</strong> that utilizes a <strong>full-stack development approach</strong> with <strong>HTML, CSS, JavaScript, PHP, and MySQL</strong>.</p>\r\n\r\n<h3><strong>Project Overview:</strong></h3>\r\n\r\n<p>This web application is built using the <strong>Laravel framework</strong>, which provides a structured and efficient way to develop PHP-based applications. It follows the <strong>MVC (Model-View-Controller) architecture</strong>, ensuring a clean separation of concerns for better maintainability and scalability.</p>', '<h3>&nbsp;</h3>\r\n\r\n<ol>\r\n	<li><strong>Laravel (PHP Framework)</strong></li>\r\n	<li><strong>HTML</strong></li>\r\n	<li><strong>CSS</strong></li>\r\n	<li><strong>JavaScript</strong></li>\r\n	<li><strong>MySQL</strong></li>\r\n</ol>', '<p>6</p>', '1740721995.png', '1740680045.png', NULL, '1740721920.png', '1740721920.png', 'Driving License', '1740721920.png', '1740721920.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 130, 0, '2025-02-27'),
(270, 61, 'Rubab', 'Khan', '8765435678', 'rubab@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '6', 90000, '3000', 5, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>Your project is a <strong>Laravel-based web application</strong> that utilizes a <strong>full-stack development approach</strong> with <strong>HTML, CSS, JavaScript, PHP, and MySQL</strong>.</p>\r\n\r\n<h3><strong>Project Overview:</strong></h3>\r\n\r\n<p>This web application is built using the <strong>Laravel framework</strong>, which provides a structured and efficient way to develop PHP-based applications. It follows the <strong>MVC (Model-View-Controller) architecture</strong>, ensuring a clean separation of concerns for better maintainability and scalability.</p>\r\n\r\n<h3>&nbsp;</h3>', '<h3>&nbsp;</h3>\r\n\r\n<ol>\r\n	<li><strong>Laravel (PHP Framework)</strong>&nbsp;</li>\r\n	<li><strong>HTML</strong></li>\r\n	<li><strong>CSS</strong>&nbsp;</li>\r\n	<li><strong>JavaScript</strong>&nbsp;</li>\r\n	<li><strong>MySQL</strong></li>\r\n</ol>', '<p>7</p>', '1740722066.png', '1740680390.png', NULL, '1740722067.png', '1740722067.png', 'Driving License', '1740722067.png', '1740722067.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 150, 0, '2025-02-27'),
(271, 48, 'Naina', 'Kumari', '7865432456', 'naina@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '21', 69000, '2300', 5, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>This system will generate and manage <strong>fake digital identities</strong> on a blockchain. Each fake ID will be stored as a <strong>non-fungible token (NFT)</strong> or a <strong>smart contract entry</strong>, making it immutable and verifiable on-chain. Users can generate fake IDs with <strong>randomized attributes</strong> such as name, DOB, and ID number while ensuring <strong>decentralized storage</strong> to maintain privacy.</p>', '<ul>\r\n	<li><strong>Ethereum</strong>&nbsp;</li>\r\n	<li><strong>Polygon (Matic)</strong>&nbsp;</li>\r\n	<li><strong>Binance Smart Chain (BSC)</strong>&nbsp;</li>\r\n	<li><strong>Hyperledger Fabric</strong>&nbsp;</li>\r\n</ul>\r\n\r\n<h4><strong>2. Smart Contract Development</strong></h4>\r\n\r\n<ul>\r\n	<li><strong>Solidity</strong>&nbsp;</li>\r\n	<li><strong>Rust</strong> &ndash; If deploying on Solana</li>\r\n	<li><strong>Hardhat / Truffle</strong> &ndash; For smart contract development &amp; testing</li>\r\n</ul>\r\n\r\n<h4><strong>3. Frontend &amp; Web3 Integration</strong></h4>\r\n\r\n<ul>\r\n	<li><strong>React.js / Next.js</strong> &ndash; For a modern DApp interface</li>\r\n	<li><strong>Web3.js / Ethers.js</strong> &ndash; For blockchain interactions</li>\r\n	<li><strong>Metamask / WalletConnect</strong> &ndash; For user authentication</li>\r\n</ul>\r\n\r\n<h4><strong>4. Decentralized Storage</strong></h4>\r\n\r\n<ul>\r\n	<li><strong>IPFS (InterPlanetary File System)</strong>&nbsp;</li>\r\n	<li><strong>Arweave / Filecoin</strong>', '<p>7</p>', '1740722148.png', '1740683800.png', NULL, '1740722149.png', '1740722149.png', 'Driving License', '1740722149.png', '1740722149.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 80, 0, '2025-02-27');
