(277, 48, 'Punit', 'kumar', '7812347575', 'punit@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1740723046.jpg', NULL, NULL, '1740723046.png', '1740723046.png', 'Driving License', '1740723046.png', '1740723046.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 60, 0, '2025-02-28'),
(278, 48, 'Ishan', 'kumar', '7543223245', 'ishan@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '12', 45000, '1500', 5, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>This project aims to create a <strong>Decentralized Identity (DID) System</strong> that allows users to verify their identities securely on the blockchain. Unlike traditional identity systems, which rely on centralized authorities (like government databases), this system gives users full control over their identity data using blockchain and cryptographic techniques.</p>', '<ul>\r\n	<li><strong>Node.js + Express.js</strong></li>\r\n	<li><strong>Web3.js / Ethers.js</strong>&nbsp;</li>\r\n	<li><strong>Infura / Alchemy</strong></li>\r\n	<li><strong>React.js / Next.js</strong></li>\r\n	<li><strong>MetaMask / WalletConnect</strong>&nbsp;</li>\r\n</ul>', '<p>7</p>', '1740723192.png', '1740717487.png', NULL, '1740723192.png', '1740723192.png', 'Driving License', '1740723192.png', '1740723192.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 80, 0, '2025-02-28'),
(279, 48, 'Dhruve', 'kumar', '9854234564', 'druve@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '10', 75000, '2500', 5, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>This project aims to create a <strong>secure, decentralized identity verification system</strong> using blockchain technology. Instead of relying on centralized databases, which are vulnerable to hacking and fraud, identity data is stored securely on a blockchain. Users can create, manage, and verify their identities in a <strong>trustless and tamper-proof</strong> way using <strong>smart contracts</strong> and <strong>decentralized storage</strong>.</p>', '<ul>\r\n	<li><strong>Node.js / Express.js</strong>&nbsp;</li>\r\n	<li><strong>Web3.js / Ethers.js</strong>&nbsp;</li>\r\n	<li><strong>Infura / Alchemy</strong>&nbsp;</li>\r\n	<li><strong>IPFS / Arweave</strong>&nbsp;</li>\r\n	<li><strong>React.js / Next.js</strong></li>\r\n	<li><strong>Wagmi / RainbowKit</strong>&nbsp;</li>\r\n	<li><strong>Tailwind CSS / Bootstrap</strong>&nbsp;</li>\r\n</ul>', '<p>8</p>', '1740723263.jpg', '1740718343.png', NULL, '1740723263.png', '1740723263.png', 'Driving License', '1740723263.png', '1740723263.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 90, 0, '2025-02-28'),
