(284, 48, 'Vikalp', 'kumar', '9999876543', 'vikalp@gmail.com', '25d55ad283aa400af464c76d713c07ad', '12345678', '14', 36000, '1200', 5, 'Noida', 'Hindi, English', NULL, NULL, NULL, NULL, NULL, '<p>This project is a <strong>decentralized KYC (Know Your Customer) system</strong> built on <strong>Binance Smart Chain (BSC)</strong>. It allows users to verify their identity once and reuse the verification across multiple platforms without repeatedly submitting personal documents. By using <strong>smart contracts and decentralized storage</strong>, it ensures <strong>privacy, security, and immutability</strong> of identity data.</p>', '<ul>\r\n	<li><strong>Node.js / Express.js</strong>&nbsp;</li>\r\n	<li><strong>Web3.js / Ethers.js</strong>&nbsp;</li>\r\n	<li><strong>Moralis / Infura / Alchemy</strong>&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>React.js / Next.js</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Wagmi / RainbowKit</strong>&nbsp;</li>\r\n	<li><strong>Tailwind CSS / Bootstrap</strong>&nbsp;</li>\r\n</ul>', '<p>11</p>', '1740723705.jpg', '1740720425.png', NULL, '1740723705.png', '1740723705.png', 'Driving License', '1740723705.png', '1740723705.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 80, 0, '2025-02-28'),
