INSERT INTO `faq_tb` (`id`, `heading`, `description`) VALUES
(2, 'Can I use an asset from Mellow Elements in a logo?', '<p><strong>Answer</strong>:</p>\r\n\r\n<p>Yes, you can.</p>'),
(3, 'Do I need to relicense Fonts or Addons each time I use them in a project?', '<p><strong><span style=\"color:#000000\">Answer</span>:</strong></p>\r\n\r\n<p>No, you do not need to relicense fonts or addons for each project. You only need to register them once for the installation on your device. If registering a font or addon to another computer you use, you need to issue a new license for that installation.</p>'),
(4, 'Can I convert HTML templates to Wordpress for my clients?', '<p><strong>Answer:</strong></p>\r\n\r\n<p>Yes, it is permissible to modify items you download on Mellow Elements in order to present them to your clients as a completed End Product. You can modify a theme in order to then use that theme to deliver your client a complete website. However, you cannot modify a template and then sell the template itself as its own product.&nbsp;</p>'),
(5, 'Is it ok to download and customise website templates for my customers?', '<p>Yes, you can, as long as your end product is a customized implementation of the website template. You will need to register your use of the item and you are allowed to sub-license the customized implementation to your client.</p>');
