(7, NULL, '14', 7, 'CRM OnePage Landing Template', '<p>1. Flat, modern, and clean design.</p>\r\n\r\n<p>2.&nbsp;Google font.</p>\r\n\r\n<p>3.&nbsp;Awesome Unique Look.</p>\r\n\r\n<p>4.&nbsp;Unique effects and functionality.</p>\r\n\r\n<p>.</p>\r\n\r\n<p>&nbsp;</p>', '1637834591.jpg', '808101685CRM1-01.jpg', 'HTML, CSS, JS', 328, 0, '1.28 MB', '<ul>\r\n	<li>\r\n	<p>Documentation Included</p>\r\n	</li>\r\n</ul>', '<p>It is an HTML one-page&nbsp;informative template.&nbsp;Users&nbsp;can use Template as a better way to present and promote their start-up, software, digital products.</p>\r\n\r\n<p><strong>HTML Files :</strong><br />\r\nCRM template coded with beautiful and clean codes!&nbsp;</p>', 'https:/lucky11.club/crm-web/', '/home4/amarbixg/mellowelements.seminator.in/public/upload\\source_code/1435887660.zip', '', NULL, NULL),
