(241, NULL, '11', 18, 'P2P EXCHANGE', '<p>CPocket is a complete CryptoCurrency secured wallet. The system platform is developed with the Laravel framework and MySQL. Our system is 100% Secure and Dynamic. It is integrated with coinpayment gateway which supports all available Cryptocurrency whose coinpayment supports. It has Buy coin functionality by bank deposit and Coin Payment gateway, It also has a deposit, Withdrawal, Referral system, Membership system, Blocked coin, and get bonus &amp; many more features that you need to run a wallet. It is the most perfect platform for creating your own currency wallet.&nbsp;<strong>The good business opportunity that it has a coin staking option and membership club functionality with configurable reward bonus.</strong></p>\r\n\r\n<p>All files and code have been well organized and nicely commented to customize. We have included a clear and detail documentation folder to describe the code structures.</p>', '1643694206.jpeg', '505010909p2p2323p.png,914745166p2p123.png,676020443p2pechange.png,802786410p2p.png', 'CYRPTO', 45000, 18, '10', '<ul>\r\n	<li>Fully responsive and dynamic dashboard</li>\r\n	<li>Easy to signup &amp; signin</li>\r\n	<li>Email verification</li>\r\n	<li>Forgot password</li>\r\n	<li>Profile management</li>\r\n	<li>Initial coin offering System;</li>\r\n	<li>Password setup</li>\r\n	<li>Security management</li>\r\n	<li>Complete user management</li>\r\n	<li>Coin management</li>\r\n	<li>Payment Method</li>\r\n	<li>Sell coin report</li>\r\n	<li>User coin order list</li>\r\n	<li>Broadcast Email</li>\r\n	<li>Bank management</li>\r\n	<li>Deposit management</li>\r\n	<li>Withdrawal management</li>\r\n	<li>Accept withdrawal and buy coin system</li>\r\n	<li>User id verification</li>\r\n	<li>Manage referral system</li>\r\n	<li>Admin settings</li>\r\n	<li>Coin Payment setting</li>\r\n	<li>Sms setting using twillo</li>\r\n	<li>Fees setting</li>\r\n	<li>FAQ Management</li>\r\n</ul>\r\n\r\n<h2><strong>User Side:</strong></h2>\r\n\r\n<ul>\r\n	<li>Fully Responsive and Dynamic</li>\r\n	<li>Easy to Signup &amp; Signin</li>\r\n	<li>Profile Management</li>\r\n	<li>User can buy coin with ban', NULL, NULL, '/home4/amarbixg/mellowelements.seminator.in/public/upload/source_code/1500465752.zip', NULL, NULL, NULL),
(242, NULL, '11', 18, 'Cryptor - NFT Marketplace & Cryptocurrency ICO Landing Template', '<ul>\r\n	<li>NFT Marketplace &amp; Cryptocurrency ICO Landing Template</li>\r\n	<li>Buy and Sell Crypto and Digital Items</li>\r\n	<li>3 Marketplace Demos in NFT Marketplace Landing</li>\r\n	<li>Light and Dark Versions Are Available</li>\r\n	<li>Experts Support</li>\r\n	<li>Easy to Customize</li>\r\n	<li>Creative And Modern Design</li>\r\n	<li>ICO industry-specific template</li>\r\n	<li>Well Documented Code</li>\r\n	<li>Unique Responsive Design</li>\r\n	<li>Retina Ready</li>\r\n	<li>Pixel Perfect</li>\r\n	<li>ICO Token, Teams, Roadmap, Features, Whitepaper, Items Explore, Items Collections, Creators, Blog, User pages, Special Pages</li>\r\n	<li>Flexible and Multi-purpose</li>\r\n	<li>6 Pre-Built Color</li>\r\n	<li>Free Google Web Fonts</li>\r\n	<li>Free Icon Fonts</li>\r\n	<li>And many More&hellip;.</li>\r\n</ul>', '1643695930.jpg', 'null', 'Blockchain and Crypto', 12128, NULL, '12 MB', '<p>PHP, HTML, CSS, JS</p>', '<p><strong>Cryptor is Responsive NFT Marketplace &amp; Cryptocurrency Landing Page Template.</strong>&nbsp;It&rsquo;s a fully responsive, super flexible, powerful, clean, and complete solution for your NFT Digital Assets Marketplace and Cryptocurrency ICO start-up agency. Every crypto business and NFT Digital Asset Marketplace have a different crowd sales process for the token sale. If you are working with any type of Digital Cryptocurrency business, NFT Marketplace, Blockchain Consulting, and Development Firm for every industry then Cryptor is the best NFT Marketplace &amp; Cryptocurrency ICO Landing Page HTML Template to launch your website.&nbsp;<strong>We have added a lot of modern creative and interesting sections like Features, About us, Whitepaper, Roadmap, Items Explore, Items Collections, Creators, Team, Tokens with Countdown, and User pages like Login, Signup and Reset password and also added special pages like coming soon and 404 error page.</strong>&nbsp;It is 100% responsive and looks stunning on all types of screens and devices. Users will love your site because it gives them a unique user experience (UX), clean, modern &amp; beautiful design. They are also easy to customize and combine with other components and&nbsp;<strong>also Light and Dark versions are included.</strong></p>', NULL, NULL, NULL, NULL, NULL),
(243, NULL, '9', 0, 'Seasonal Loving Scene Situation', NULL, NULL, 'null', 'After Effects', 455, NULL, '40.6 MB', '<ul>\r\n	<li>\r\n	<h2><strong><span style=\"font-size:12px\">Required Plugins</span></strong></h2>\r\n	None required</li>\r\n	<li>\r\n	<h2><strong><span style=\"font-size:12px\">Applications Supported</span></strong></h2>\r\n	After Effects</li>\r\n</ul>', NULL, NULL, NULL, '1262233338.m4v', NULL, '1920 x 1080'),
(319, NULL, '12', 6, 'Music Logo E', '<ul>\r\n	<li>100% Scalable Vector Files</li>\r\n	<li>Everything is resizable</li>\r\n	<li>Everything is editable</li>\r\n	<li>Easy to edit color/text</li>\r\n	<li>Exeleent Quality</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '1644823210.jpg', 'null', 'AI, JPG, PNG', 75, NULL, '4.46 MB', '<p>Vector File</p>\r\n\r\n<p>&nbsp;</p>', '<p>Suitable for your design needs, This template are 100% vector work, everything is editable, easy to resize.&nbsp;</p>', NULL, '/home4/amarbixg/mellowelements.seminator.in/public/upload/source_code/311438987.zip', NULL, NULL, NULL),
(339, NULL, '12', 6, 'Gaming Logo 1', '<p>100% Vector Editable High Quality Scalable Easy to use</p>', '1644828750.jpg', 'null', 'AI, JPG, PNG', 115, NULL, '1.36 MB', '<p>Vector File</p>', '<p>Suitable for Creative Industry, Sports, Esports, Team, Multimedia, entertainment, Educations, Shop, and any related business</p>', NULL, '/home4/amarbixg/mellowelements.seminator.in/public/upload/source_code/941832894.zip', NULL, NULL, NULL),
(356, NULL, '12', 6, 'Digital Marketing Logo 1', '<ul>\r\n	<li>File format AI&nbsp;</li>\r\n	<li>100% vector (Resizable).</li>\r\n	<li>Color mode: CMYK.</li>\r\n	<li>300 Dpi</li>\r\n</ul>', '1644835712.jpg', 'null', 'AI, JPG, PNG', 150, NULL, '2.53 MB', '<p>Vector File</p>', '<p>The logo above is designed with professional approach in Adobe Illustrator. The package contains versions for different backgrounds, and one color mode. The source files are easy to edit (name/colors/arrangement/size)</p>', NULL, '/home4/amarbixg/mellowelements.seminator.in/public/upload/source_code/844266633.zip', NULL, NULL, NULL),
(395, NULL, '12', 4, 'Understanding viral content marketing Infographics', NULL, NULL, 'null', 'AI (Adobe Illustrator)', 270, NULL, '5.08 MB', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(426, NULL, '12', 22, 'SEO TEMPLATE', '<p>JPG images</p>\r\n\r\n<p>AI File</p>\r\n\r\n<p>Easy to customize</p>', '1645075220.jpg', 'null', 'AI, JPG', 115, NULL, '7.75 MB', '<p>AI file</p>', '<p>Seo analysis modern flat design concept. Landing page template. Modern flat vector illustration concepts for Social Medi Poster. Easy to edit and customize.</p>', NULL, '/home4/amarbixg/mellowelements.seminator.in/public/upload/source_code/39811307.zip', NULL, NULL, NULL);
