(4, 'CLOUD HOSTING', '549', '<p><strong>Unlimited</strong>&nbsp;Websites.</p>\r\n\r\n<p><strong>Unmetered&nbsp;SSD</strong>&nbsp;Space.</p>\r\n\r\n<p><strong>Unmetered</strong>&nbsp;Transfer.</p>\r\n\r\n<p><strong>FREE SSL</strong>&nbsp;Certificate.<img alt=\"\" src=\"https://www.bigrock.in/ui/resellerdata/240000_269999/247133/supersite2/bigrock/themes/ClassicBlue-MyTheme/images/myUploadedImages/ssl_pricing_plan.png\" /></p>\r\n\r\n<p><strong>4 GB</strong>&nbsp;RAM.</p>\r\n\r\n<p><strong>2x</strong>&nbsp;Faster Load Time.</p>\r\n\r\n<p><strong>4x</strong>&nbsp;Scalable Resources.</p>');
